import React from "react";
import { Link, useNavigate } from "react-router-dom";

const Navbar = ({ onLogout, userData }) => {
  const navigate = useNavigate();

  return (
    <nav style={{ 
      display: "flex", 
      justifyContent: "space-between", 
      alignItems: "center",
      padding: "10px 20px",
      background: "#282c34", 
      color: "#fff"
    }}>
      <div>
        <Link to="/" style={{ color: "#fff", marginRight: "15px" }}>Summary</Link>
        <Link to="/orders" style={{ color: "#fff", marginRight: "15px" }}>Orders</Link>
        <Link to="/holdings" style={{ color: "#fff", marginRight: "15px" }}>Holdings</Link>
        <Link to="/positions" style={{ color: "#fff", marginRight: "15px" }}>Positions</Link>
        <Link to="/funds" style={{ color: "#fff", marginRight: "15px" }}>Funds</Link>
        <Link to="/apps" style={{ color: "#fff" }}>Apps</Link>
      </div>

      <div>
        {userData && (
          <span style={{ marginRight: "15px" }}>
            Hi, <b>{userData.username}</b>
          </span>
        )}
        <button onClick={onLogout} style={{
          background: "red",
          color: "white",
          border: "none",
          padding: "8px 12px",
          borderRadius: "5px",
          cursor: "pointer"
        }}>
          Logout
        </button>
      </div>
    </nav>
  );
};

export default Navbar;
